import React from 'react';
import './Solution.css';
import AutoblurSelect from '../autoblurSelect/AutoblurSelect';


class Solution extends React.Component {

  handleKeyPress = (event) => {
    if (event.key == 'ArrowUp') {
        console.log( "up");
    }
    else if (event.key == 'ArrowDown') {
        console.log( "down");
    }
    else if (event.key == 'ArrowLeft') {
       console.log( "left");
    }
    else if (event.key == 'ArrowRight') {
       console.log( "right");
    }

}


  render() {
    return (
      <div>
        <AutoblurSelect className="form-control">
          {
            [0,1,2,3,4,5,6].map((i,j) => {
              return <option value={j+1}  key={j}>
                        {i}
                      </option>
            })
          }
          <input type="text" id="one" onKeyDown={this.handleKeyPress} />
        </AutoblurSelect> 
      </div>
      );
  }
}

export default Solution;
